solution:
Vì chúng ta biết rằng $f(x)=x^2+1$ và $g(x)=2x-1$, biểu thức cho $f(g(x))$ chỉ là $(2x-1)^2+1$. Từ đây, chúng ta chỉ có thể cắm 5 làm giá trị cho $x đô la. \begin{align*} (f(g(5))&=(2(5)-1)^2+1
\\ &=(10-1)^2+1
\\ &=(9)^2+1
\\ &=81+1
\\ &=\đóng hộp{82}
\end{align*}

Khi sử dụng thuộc tính phân phối lần đầu tiên, chúng ta thêm tích $x+2$ và $x$ vào tích $x+2$ và 5:

\begin{align*}
(x+2) (x+5) &= (x+2) \cdot x + (x+2) \cdot 5\\
&= x(x+2) + 5(x+2)
\end{align*} Chúng ta sử dụng lại thuộc tính phân phối và kết hợp các thuật ngữ tương tự:

\begin{align*}
x(x+2) + 5(x+2) &= x^2 + 2x + 5x+ 10\\
&= \boxed{x^2 + 7x + 10}
\end{align*}

Chúng ta có thể chỉ cần nạp $16^{\frac{1}{2}}=4$ and $625^{\frac{1}{2}}=25$ và nhận $4-25=-21$. Ngoài ra, nhận ra vấn đề là sự khác biệt của hình vuông, chúng ta có thể viết lại nó thành \begin{align*}
(16^{\frac{1}{4}})^2-(625^{\frac{1}{4}})^2&=(16^{\frac{1}{4}}-625^{\frac{1}{4}})(16^{\frac{1}{4}}+625^{\frac{1}{4}}) \\
&=(2-5)(2+5)\\
&=(-3)(7)=\boxed{-21}.
\end{align*}

Khi sử dụng thuộc tính phân phối lần đầu tiên, chúng tôi thêm sản phẩm $ 2x + 3 $ và $x $ vào sản phẩm $ 2x + 3 $ và 5:

\begin{align*}
(2x+3) (x+5) &= (2x+3) \cdot x + (2x+3) \cdot 5\\
&= x(2x+3) + 5(2x+3)
\end{align*} Chúng ta sử dụng lại thuộc tính phân phối và kết hợp các thuật ngữ tương tự:

\begin{align*}
x(2x+3) + 5(2x+3) &= 2x^2 + 3x + 10x+ 15\\
&= \boxed{2x^2 + 13x + 15}
\end{align*}

Khi sử dụng thuộc tính phân phối, chúng ta thêm các tích của 3 và $8x^2$, 3 và $-2x$, và 3 và 1: \begin{align*}
3(8x^2-2x+1) &= 3\cdot 8x^2+3\cdot (-2x) + 3 \cdot 1\\
&= \boxed{24x^2-6x+3}
\end{align*}

