Hàng 4: &, 16 &, 17 &, 18 &, 19 &; 20
\end{bảng}

solution:
Khi sử dụng thuộc tính phân phối, chúng ta thêm tích $9x$ và $2x^2$ vào tích của 4 và $2x^2$:\begin{align*}
(9x+4)\cdot 2x^2 &= 9x\cdot 2x^2+4\cdot 2x^2\\
&= \boxed{18x^3+8x^2}.
\end{align*}

