Tam giác $POD$ là một tam giác 45-45-90, vì vậy $DO = DP = \frac{\sqrt{2}}{2}$.  Do đó, tọa độ của $P$ là $\left(-\frac{\sqrt{2}}{2}, -\frac{\sqrt{2}}{2}\right)$, so $\tan 225^\circ = \frac{\sin 225^\circ}{\cos 225^\circ} = \frac{-\sqrt{2}/2}{-\sqrt{2}/2} = \boxed{1}$.

