solution:
Chúng ta chia hai đa thức đã cho để thu được \[
\begin{mảng}{c|ccccc}
\multicolumn{2}{r}{x^3} & +3x^2 & +9x & +28 & +\frac{86}{x-3} \\
\cline{2-6}
x-3 & x^4 & +0x^3 & +0x^2 &+ x &+ 2 \\
\multicolumn{2}{r}{-x^4} & +3x^3 & \\ \cline{2-3}
\multicolumn{2}{r}{0} & 3x^3 & & & \\
\multicolumn{2}{r}{} & -3x^3 & + 9x^2 & & \\ \cline{3-4}
\multicolumn{2}{r}{} & & 9x^2 & & \\
\multicolumn{2}{r}{} & & -9x^2 &+27x & \\ \cline{4-5}
\multicolumn{2}{r}{} & & &+28x & \\
\multicolumn{2}{r}{} & & &-28x & +84 \\ \cline{5-6}
\multicolumn{2}{r}{} & & & & 86, \\
\end{mảng}
\]cho thấy phần còn lại là $\boxed{86}$. Ngoài ra, chúng ta có thể sử dụng định lý phần dư, trong đó nói rằng phần còn lại khi đa thức $p(x)$ được chia cho $x-a$, phần còn lại là $p(a)$. Chúng tôi thấy rằng phần còn lại là $ 3 ^ 4 + 3 + 2 = 86 $.

