solution:
Phần còn lại khi $ 37 + 49 + 14 $ được chia cho $ 12 $ giống như phần còn lại khi các đồng dạng của mỗi số mod 12 được tính tổng và sau đó chia cho 12. Nói cách khác, vì chúng ta có \begin{align*}
37 &\equiv 1\pmod{12}\\
49 &\equiv 1\pmod{12} \\
14 &\equiv 2\pmod{12}
\end{align*}thì do đó, $37+49+14 \equiv1+1+2 \equiv \boxed{4}\pmod{12}$.

