solution:
Khi giải quyết vấn đề này, chúng ta phải nhớ áp dụng thứ tự các hoạt động. Đầu tiên, chúng ta thực hiện tất cả các trường hợp nhân và chia từ trái sang phải để thu được

\begin{align*}
1+6\cdot2-3+5\cdot4\div2&=1+12-3+5\cdot4\div2\\
&=1+12-3+20\div 2\\
&=1+12-3+10.
\end{align*}Tiếp theo, chúng ta thực hiện tất cả các phép cộng và trừ cần thiết từ trái sang phải. Chúng ta nhận được \begin{align*}
1+12-3+10&=13-3+10\\
&=10+10\\
&=\đóng hộp{20}.
\end{align*}

Từ bài toán, ta có thể viết phương trình sau: \[3B + 2 = 20.\]Đơn giản hóa, \begin{align*}
3B &= 18\\
B &= \boxed{6}.
\end{align*}

