solution:
Đơn giản hóa, ghi nhớ số mũ được ưu tiên hơn phép nhân và phép nhân được ưu tiên hơn phép cộng hoặc trừ. \begin{align*}
5^3-3\times 5^2+3\times5-1&=125-3\times25+15-1 \\
&=125-75+14 \\
&= 50+14 \\
&= \đóng hộp{64}.
\end{align*}

Theo thứ tự các phép toán (tính tổng bằng $(4+8)^2$ trước khi áp dụng số mũ $(4+8)^2$), ta có \begin{align*}
(4+8)^2 + (4^2 + 8^2) &= (12)^2 + (4^2 + 8^2)\\
&= 144 + (16+64) \\
&= 144+ 80 \\
&= \boxed{224}.\end{align*}

Chúng tôi được yêu cầu giải quyết $ 27 + 2x = 39 $ cho $x $.  Ta trừ 27 vế cho cả hai vế và sau đó nhân cả hai vế với $\frac{1}{2}$: \begin{align*}
27+2x&=39 \\
2x &= 12 \\
x &= \ đóng hộp{6}.
\end{align*}

Hãy thay thế các giá trị đã cho vào biểu thức. Chúng ta nhận được \begin{align*}
(a^3+b^3)\div(a^2-ab+b^2)&=(5^3+4^3)\div(5^2-5\cdot4+4^2)\\
&=(125+64)\div(25-20+16)\\
&=189\div21\\
&=\đóng hộp{9}.
\end{align*}

Có 5 số trong tập hợp này, vì vậy chúng ta có \begin{align*}
\frac{6+13+18+4+x}{5}&=10 \\
6+13+18+4+x&=50 \\
6+4+13+18+x&=50 \\
10+31+x &=50 \\
41+x&=50 \\
x &= \đóng hộp{9}
\end{align*}

