solution:
Hãy để số ban đầu của Pete là $x $.  Nếu anh ta nhân đôi nó và thêm 10, anh ta sẽ có $ 2x + 10.$ $ Sau khi nhân với 4, Pete kết thúc với 120.  Từ thông tin này, chúng ta có phương trình: $$4(2x+10)=120.$$ Mở rộng phía bên trái và giải quyết, chúng ta tìm thấy:

\begin{align*}
8x+40&=120\\
\Mũi tên phải\qquad 8x&=80\\
\Mũi tên phải \qquad x&=\boxed{10}.
\end{align*}

Chúng ta giải quyết dấu ngoặc đơn, sau đó là số mũ, rồi tích tích, rồi tổng: \begin{align*}
8+6(3-8)^2 &= 8 + 6(-5)^2\\
&= 8+6\cdot 25\\
&= 8+150\\
&=\đóng hộp{158}.
\end{align*}

Hãy nhớ lại rằng phép nhân và phép chia nên được thực hiện trước khi cộng và trừ. Chúng ta nhận được \begin{align*}
4+10\div2-2\cdot3&=4+5-6\\
&=9-6\\
&=\đóng hộp{3}.
\end{align*}

