Lưu ý cách dấu ngoặc đơn chỉ xoay quanh các cặp số đang được nhân hoặc chia. Vì phép nhân và phép chia được thực hiện trước khi cộng và trừ, nên không thành vấn đề nếu chúng ta loại bỏ dấu ngoặc đơn. Đó là lý do tại sao \begin{align*}
