solution:
Hãy để $P$ là điểm trên vòng tròn đơn vị là $ 60 ^ \ circ $ ngược chiều kim đồng hồ từ $ (1,0) $ và $D $ là chân của độ cao từ $P $ đến trục $x $, như hình dưới đây.

[tị nạn]

cặp A, C, P, O, D;

vẽ ((0,-1,2)--(0,1,2),p = đen + 1,2bp, Mũi tên (0,15cm));

vẽ ((-1,2,0) --(1,2,0), p = đen + 1,2bp, Mũi tên (0,15cm));

A = (1,0);

O = (0,0);

nhãn ("$x$",(1,2,0),SE);

nhãn ("$y$",(0,1,2),NE);

P = xoay (60) * A;

D = chân (P, A, -A);

vẽ (O--P--D);

vẽ (dấu vuông (O, D, P, 2));

vẽ (Vòng tròn (O,1));

nhãn ("$O$",O,SE);

nhãn ("$P$",P,NE);

nhãn ("$A$",A,SE);

nhãn ("$D$", D, S);

[/asy]

Tam giác $POD$ là tam giác 30-60-90, do đó $DO = \frac{1}{2}$ và $DP = \frac{\sqrt{3}}{2}$.  Do đó, tọa độ của $P$ là $\left(\frac{1}{2}, \frac{\sqrt{3}}{2}\right)$, vậy $\tan 60^\circ =\frac{\sin 60^\circ}{\cos 60^\circ} = \frac{\sqrt{3}/2}{1/2} = \boxed{\sqrt{3}}$.

Chúng ta có thể mở rộng định thức như sau:
\begin{align*}
\begin{vmatrix} 0 & \sin \alpha & -\cos \alpha \\ -\sin \alpha & 0 & \sin \beta \\ \cos \alpha & -\sin \beta & 0 \end{vmatrix} &= -\sin \alpha \begin{vmatrix} -\sin \alpha & \sin \beta \\ \cos \alpha & 0 \end{vmatrix} - \cos \alpha \begin{vmatrix} -\sin \alpha & 0 \\ \cos \alpha & -\sin \beta \end{vmatrix} \\
&= -\sin \alpha (-\sin \beta \cos \alpha) - \cos \alpha (\sin \alpha \sin \beta) \\
&= \đóng hộp{0}.
\end{align*}

