solution:
Vì đồ thị của $y = 3 \sin \left( x - \frac{\pi}{5} \right)$ giống như đồ thị của $y = 3 \sin x$ dịch chuyển đơn vị $\frac{\pi}{5}$ sang phải, nên sự dịch pha là $\boxed{\frac{\pi}{5}}.$

[asy] nhập khẩu TrigMacros;

kích thước (400);

G thực (X thực)
{
	trả về 3*sin(x - pi/5);
}

F thực (X thực)
{
	trả về 3*sin(x);
}

vẽ (đồ thị (g, -3 * pi, 3 * pi, n = 700, tham gia = toán tử ..), màu đỏ);
vẽ (đồ thị (f, -3 * pi, 3 * pi, n = 700, tham gia = toán tử ..));
trig_axes (-3 * pi, 3 * pi, -4,4, pi / 2,1);
lớp();
rm_trig_labels(-5, 5, 2);
[/asy]

Từ công thức cộng góc, chúng ta có thể viết
\begin{align*}
\sin x + \cos x &= \sqrt{2} \left( \frac{1}{\sqrt{2}} \sin x + \frac{1}{\sqrt{2}} \cos x \right) \\
&= \sqrt{2} \left( \cos \frac{\pi}{4} \sin x + \sin \frac{\pi}{4} \cos x \right) \\
&= \sqrt{2} \sin \left( x + \frac{\pi}{4} \right).
\end{align*}Do đó, đồ thị của $y = \sin x + \cos x$ có period $\boxed{2 \pi}.$

Biểu đồ của $y = \sin x + \cos x$ được hiển thị bên dưới:

[asy] nhập khẩu TrigMacros;

kích thước (400);

G thực (X thực)
{
	trả lại sin(x) + cos(x);
}

vẽ (đồ thị (g, -3 * pi, 3 * pi, n = 700, tham gia = toán tử ..), màu đỏ);
trig_axes(-3*pi,3*pi,-2,2,pi/2,1);
lớp();
rm_trig_labels(-5, 5, 2);
[/asy]

Đồ thị của $y=\tan \frac{x}{2}$ đi qua một chu kỳ đầy đủ vì $\frac{x}{2}$ dao động từ $-\frac{\pi}{2}$ đến $\frac{\pi}{2},$ có nghĩa là $x$ dao động từ $-\pi$ đến $\pi.$ Do đó, period là $\pi - (-\pi) = \boxed{2 \pi}.$

Biểu đồ của $y=\tan \frac{x}{2}$ được hiển thị bên dưới:

[asy] nhập khẩu TrigMacros;

kích thước (400);

G thực (X thực)
{
	trở về Tân(x/2);
}

vẽ (đồ thị (g, -3 * pi + 0,01,-pi - 0,01), màu đỏ);
vẽ (đồ thị (g, -pi + 0, 01, pi - 0, 01), màu đỏ);
vẽ (đồ thị (g, pi + 0,01,3 * pi - 0,01), màu đỏ);
giới hạn ((-3 * pi, -5), (3 * pi, 5), Cây trồng);
vẽ ((-pi,-5)--(-pi,5),đứt nét);
vẽ ((pi,-5)--(pi,5),đứt nét);
trig_axes (-3 * pi, 3 * pi, -5,5, pi / 2,1);
lớp();
rm_trig_labels(-5, 5, 2);
[/asy]

Mỗi điểm trên đồ thị có khoảng cách 2 từ gốc, vì vậy đồ thị là một vòng tròn.

[tị nạn]
