vẽ (Vòng tròn ((0,0), 1), màu đỏ);
hòa ((-1,2,0)--(1,2,0));
hòa ((0,-1,2)--(0,1,2));

nhãn ("$r = 2$", (1,2,0,8), màu đỏ);
[/asy]

Câu trả lời là $\boxed{\text{(B)}}.$

Biểu đồ của $y = \sin 5x$ đi qua một khoảng thời gian đầy đủ vì $ 5x$ dao động từ $ 0 $ đến $ 2 \ pi $, có nghĩa là $x $ dao động từ $ 0$ đến $ \boxed{\frac{2\pi}{5}}.$

Biểu đồ $y = \sin 5x$ được hiển thị bên dưới:

[tị nạn]
nhập TrigMacros;

kích thước (400);

G thực (X thực)
