trig_axes(-3*pi,3*pi+.4,-2,2,pi,1);
lớp();
rm_trig_labels(-3, 3, 1);
[/asy]

Hãy xem xét một tam giác vuông trong đó cạnh đối diện là 2 và cạnh huyền là 3.

[tị nạn]
kích thước đơn vị (1 cm);

draw((0,0)--(sqrt(5),0)--(sqrt(5),2)--cycle);

nhãn ("$\sqrt{5}$", (sqrt(5)/2,0), S);
nhãn ("$3$", (sqrt(5)/2,1), Tây Bắc);
nhãn ("$2$", (sqrt(5),1), E);
nhãn ("$\theta$", (0,7,0,3));
[/asy]

Khi đó $\sin \theta = \frac{2}{3},$ so $\theta = \arcsin \frac{2}{3}.$ Theo Pythagoras, cạnh liền kề là $\sqrt{5},$ so $\cos \theta = \boxed{\sqrt{\sqrt{5}}{3}}.$

Đồ thị của $y=\cos \frac{x}{2}$ đi qua một chu kỳ đầy đủ là $\frac{x}{2}$ dao động từ $0$ đến $2\pi,$ có nghĩa là $x$ dao động từ $0$ đến $\boxed{4 \pi}.$

Biểu đồ của $y=\cos \frac{x}{2}$ được hiển thị bên dưới:

[asy] nhập khẩu TrigMacros;

kích thước (400);

G thực (X thực)
{
	trả lại cos (x / 2);
}

vẽ (đồ thị (g, -3 * pi, 3 * pi, n = 700, tham gia = toán tử ..), màu đỏ);
trig_axes(-3*pi,3*pi,-2,2,pi/2,1);
lớp();
rm_trig_labels(-5, 5, 2);
[/asy]

Chúng tôi có điều đó
\begin{align*}
\frac{\tan^2 20^\circ - \sin^2 20^\circ}{\tan^2 20^\circ \sin^2 20^\circ} &= \frac{\frac{\sin^2 20^\circ}{\cos^2 20^\circ} - \sin^2 20^\circ}{\frac{\sin^2 20^\circ}{\cos^2 20^\circ} \cdot \sin^2 20^\circ} \\
&= \frac{\sin^2 20^\circ - \cos^2 20^\circ \sin^2 20^\circ}{\sin^4 20^\circ} \\
&= \frac{1 - \cos^2 20^\circ}{\sin^2 20^\circ} = \boxed{1}.
\end{align*}

Hãy xem xét một tam giác vuông trong đó cạnh đối diện là 5 và cạnh huyền là 13.

[tị nạn]
kích thước đơn vị (0,3 cm);

rút ra ((0,0) - (12,0) - (12,5) - chu kỳ);

nhãn ("$ 12 $", (6,0), S);
nhãn ("$ 13 $", (6,5 / 2), Tây Bắc);
nhãn ("$ 5 $", (12,5 / 2), E);
nhãn ("$\theta$", (5,1));
[/asy]

Khi đó $\sin \theta = \frac{5}{13},$ so $\theta = \arcsin \frac{5}{13}.$ Theo Pythagoras, cạnh liền kề là 12, vì vậy $\cos \theta = \boxed{\frac{12}{13}}.$

Hãy xem xét một tam giác vuông trong đó cạnh liền kề là 4 và cạnh đối diện là 7.

[tị nạn]
kích thước đơn vị (0,5 cm);

rút ra ((0,0) - (4,0) - (4,7) - chu kỳ);

nhãn ("$ 4 $", (2,0), S);
nhãn ("$ 7 $", (4,7 / 2), E);
nhãn ("$\theta$", (0,8,0,5));
[/asy]

Sau đó $\cot \theta = \frac{4}{7},$ so $\theta = \operatorname{arccot} \frac{4}{7}.$ Do đó, $\tan \theta = \frac{1}{\cot \theta} = \boxed{\frac{7}{4}}.$

Đồ thị của cả $\tan x$ và $\cot x$ đều có period $\pi.$ Điều này có nghĩa là đồ thị $y = \tan x + \cot x$ lặp lại sau một khoảng thời gian $\pi,$ nhưng điều này không nhất thiết cho thấy period là $\pi.$

Chúng ta có thể viết
\[y = \tan x + \cot x = \frac{\sin x}{\cos x} + \frac{\cos x}{\sin x} = \frac{\sin^2 x + \cos^2 x}{\sin x \cos x} = \frac{1}{\sin x \cos x}.\]If $0 < x < \frac{\pi}{2},$ then $\sin x > 0$ and $\cos x > 0,$ so $\frac{1}{\sin x \cos x} > 0.$

Nếu $\frac{\pi}{2} < x < \pi,$ thì $\sin x > 0$ và $\cos x < 0,$ so $\frac{1}{\sin x \cos x} < 0.$ Nếu $\pi < x < \frac{3 \pi}{2},$ thì $\sin x < 0$ và $\cos x < 0,$ so $\frac{1}{\sin x \cos x} > 0.$

Do đó, đồ thị của $y = \tan x + \cot x$ cũng có period $\boxed{\pi}.$

Biểu đồ của $y = \tan x + \cot x$ được hiển thị bên dưới:

[asy] nhập khẩu TrigMacros;

kích thước (400);

G thực (X thực)
{
	trả lại tan(x) + cũi(x);
}

vẽ (đồ thị (g, -3 * pi + 0,01,-5/2 * pi - 0,01), màu đỏ);
vẽ (đồ thị (g, -5/2 * pi + 0,01,-2 * pi - 0,01), màu đỏ);
vẽ (đồ thị (g, -2 * pi + 0,01,-3/2 * pi - 0,01), màu đỏ);
vẽ (đồ thị (g, -3/2 * pi + 0,01,-pi - 0,01), màu đỏ);
vẽ (đồ thị (g, -pi + 0,01,-1 / 2 * pi - 0,01), màu đỏ);
