Vì $\mathbf{a}$ và $-\mathbf{a}$ trỏ theo hướng ngược nhau, góc giữa chúng là $180^\circ.$ Khi đó góc giữa $-\mathbf{a}$ và $\mathbf{b}$ là $180^\circ - 43^\circ = \boxed{137^\circ}.$

[tị nạn]
đơn vị kích thước (2 cm);

cặp A, B, O;

A = 2 * dir (12);
B = dir(12 + 43);
O = (0,0);

vẽ (O--A, đỏ, Mũi tên (6));
vẽ (O--B, đỏ, Mũi tên (6));
vẽ (O--(-A), màu đỏ, Mũi tên (6));

nhãn ("$\mathbf{a}$", (O + A)/2, S);
label("$\mathbf{b}$", (O + B)/2, Tây Bắc);
label("$-\mathbf{a}$", (O + (-A))/2, S);
nhãn("$43^\circ$", (0.4,0.25));
nhãn ("$137^\circ$", (-0.15,0.15));
[/asy]

